import React from "react";
import './Services.css'
import HeartEmoji from "../../img/heartemoji.png";
import Glasses from "../../img/glasses.png";
import Humble from "../../img/humble.png"
import Card from "../Card/Card";
const Services = () =>{
    return(
        <div className="services">
            { /* left side */}
            <div className="awesome">
            <span></span>
            <span>Coordonnées,Etudes et Expériences</span>
            <spane>
                Je m'appelle ANDRIAMANAMPY Hajatiana, j'ai 25 ans et je suis un jeune diplômé et passioné dans <br/>le domaine informatique. Je fais mon étude universitaire à l'Ecole <br/>
                 Nationale d'Informatique abrégée ENI et j'ai obtenu mon diplôme de Master professionel dans cette école.<br/>
                 <ul>
                    <li>Date et Lieu de naissance : 28 Février 1999 à Ambositra</li>
                 </ul>
                
            </spane>
            <button className="button s-button">Download CV</button>
            <div className="blur s-blur1" style={{background: "#ABF1FF94" }}></div>

            </div>
            {/* right side */}
            <div className="cards">
                <div style={{left: '14rem'}}>
                    <Card
                    emoji = {HeartEmoji}
                    heading = {'Design'}
                    detail = {"Figma, Sketch, Photoshop, Adobe, Adobe xd"}
                    />
                </div>

            {/* second card */}
            <div style={{top: '12rem', left: '-4rem'}}>
                <Card
                emoji={Glasses}
                heading={"Developer"}
                detail={"HTML, CSS, JS, React, Tailwindcss, Next.js"}
                />
            </div>
            {/* 3rd Card*/}
            <div style={{top: '19rem', left: '12rem'}}>
               <Card
                emoji={Humble}
                heading={"UI/UX"}
                detail={
                    'Lorem upsum text are usually use in section'
                }
               /> 
            </div>
            <div className="blur s-blur2" style={{background: "var(--purple)"}}></div>

            </div>
        </div>
    )

  { 

  }  
    
   
}
export default Services;
